import { Component, React } from 'react';
import { Col, Row, Container } from 'react';

class DisplaySearch extends Component {
constructor(props) {
    super(props);
    this.state = {Content: {}}
}
    componentDidMount() {
        fetch("/Data")
        .then(res => res.json())
        .then(
            (result) => {
                console.log(result);
                this.setState({
                    Content: result
                });
            },
            (error) => {
                console.log(error);
                this.setState({
                    Content: error
                });
            }
        )
        
    }

    render() {

        return (
            <div>

                <Container>
                    <Row>
                        <Col>
                        <p>{this.state.Content}</p>
                        </Col>
                    </Row>



                </Container>


            </div>
        )


    }


}

export default DisplaySearch;
